import React, { Component } from "react";
import Footer from "./ApplicantPages/Footer";
import LeftMenu from "./ApplicantPages/LeftMenu";
import Login from "./ApplicantPages/Login";
import Menu from "./ApplicantPages/Menu";

export default class Root extends React.Component {
  render() {
    return (
      <div className="wrapper">
        <div className="row">
          <div className="col-md-2 pr-1"><LeftMenu/></div>

          <div className="col-md-10 ">
            <div className="row">
              <div className="col-md-12 pr-1" style={{marginLeft: "10px"}}>
                  <Menu/>

              </div>
            </div>{" "}
            <div className="row">
              <div className="col-md-9 pr-1"  style={{padding: "70px"}}>

                {this.props.children}
              </div>
              <div className="col-md-3 pr-1" style={{paddingRight: "5px",paddingTop: "100px"}}>
                  <Login/>
                  </div>
            </div>
            <div className="row" >
              <div className="col-md-12 pr-1"><Footer/></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
